import { Vigneron as VigneronData } from '../../../Back_End/FichiersGood-main/Back-end/back-end/src/db/sequelize';

function VigneronComponent() {
    const [vignerons, setVignerons] = useState([]);

    useEffect(() => {
        fetch('http://localhost:3001/api/vignerons')
        .then(response => response.json())
        .then(data => {
            console.log('Data received:', data);
            setVignerons(data); // corrected from setEvenements to setVignerons
        })
        .catch(error => {
            console.error('Fetch error:', error);
        });
    }, []);

    return (
        <div>
            {/* existing HTML and JSX code */}
            <h2>Liste des Vignerons</h2>
            {vignerons.length > 0 ? (
                vignerons.map(vigneron => ( // changed evt to vigneron for clarity
                    <div key={vigneron.id}>
                        <h2>{vigneron.name}</h2>
                        {/* other properties of vigneron as needed */}
                    </div>
                ))
            ) : (
                <p>Aucun vigneron Ã  afficher</p>
            )}
        </div>
    );
}

export default VigneronComponent;
